pragma solidity ^0.4.23;

import './Stage1.sol';
//import './Stage2.sol';
//import './Stage3.sol';

contract Voting is
  Stage1/*,
  Stage2,
  Stage3*/
{
  using SafeMath for uint256;

  constructor(bytes32[] proposalsNames)
    Stage1(
      'Blockchain Developers Moldova', // name
      'https://www.facebook.com/groups/592057231174722', // website
      'https://avatars3.githubusercontent.com/u/38734481', // logo
      proposalsNames // available proposals
    )
     //Stage2(
     //  1525132800, // start time
     //  1527811200 // end time
     //)
    public
  {
      // @todo your code
  }

  /** Stage 1 */

  function getProposals() view public returns (bytes32[]) {
    bytes32[] memory res = new bytes32[](proposals.length);
    for (uint p = 0; p < proposals.length; p++) {
        res[p] = proposals[p].name;    
        }
    return res;
  }

  function vote(bytes32 proposal) public {
        Voter storage sender = voters[msg.sender];
        require(!sender.voted, "Already voted.");
        sender.voted = true;
        sender.vote = proposal;
        proposals[getProposalRef ( proposal )].voteCount++;
        totalVoteCount++;
        emit Voted(msg.sender,proposal);
  }

  function hasVoted(address voter) view public returns (bool) {
      return voters[voter].voted;
  }

  function getVote(address voter) view public returns (bytes32) {
      require( voters[voter].voted, "Not voted");
      return voters[voter].vote;

    
  }

  function getProposalVoteCount(bytes32 proposal) view public returns (uint256) {
    return proposals[getProposalRef ( proposal )].voteCount;
  }

  function getLeader() view public returns (bytes32) {
    uint winCounter = 0;
    uint Proposal_winner;
        for (uint p = 0; p < proposals.length; p++) {
            if (proposals[p].voteCount > winCounter) {
                winCounter = proposals[p].voteCount;
                Proposal_winner = p;
            }
        }
        return proposals[Proposal_winner].name;
  }

